import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import { useSelector, useDispatch } from 'react-redux';

import { toggleSidebar } from '../../redux/actions'
import FavCountry from './FavCountry'
const useStyles = makeStyles({

});

export default function FavDrawer() {
    const classes = useStyles();
    const dispatch = useDispatch();
    const isOpened = useSelector(store => store.toggle.open)
    const favCountries = useSelector(store => store.favCountries.favCountries)
    console.log(favCountries);

    const close = () => {
        dispatch(toggleSidebar());
    }

    return (
        <div>
            <React.Fragment>
                <Drawer
                    anchor="right"
                    open={isOpened}
                    onClose={close}>
                        <h1></h1>
                    {favCountries.map(fav => {
                        <FavCountry key={fav.name} country={fav} />
                    })}
                </Drawer>

            </React.Fragment>

        </div>
    );
}
